import React from 'react';
import Header from '../components/header'; // Verifica que la ruta sea correcta
import '../styles.css'; // Verifica que la ruta sea correcta

const HomePage = () => {
  // URL de la imagen de Internet
  const imageUrl = 'https://example.com/path/to/your/image.jpg';

  return (
    <div>
      <Header />
      <h1>Aprovecha y llévate una planta para tu jardín</h1>
      <img src={imageUrl} alt="Planta para jardín" className="home-image" />
    </div>
  );
  }
